import * as React from "react";

export const ProductItem = ({ Carbohydrates,
  Fat,
  Fiber,
  KiloJoules,
  ProductCategoryId,
  Protein,
  Salt,
  name,
   }) => {
  return (
    <li className="item">
      <img src={avatarUrl} className="ui mini rounded image" alt={name} />
      <div className="content">
        <h4 className="header">{name}</h4>
        <div className="description">{Carbohydrates}</div>
        <div className="description">{Fat}</div>
        <div className="description">{Fiber}</div>
        <div className="description">{KiloJoules}</div>
        <div className="description">{ProductCategoryId}</div>
        <div className="description">{Protein}</div>
        <div className="description">{Salt}</div>
        <div className="description">{avatarUrl}</div>
      </div>
    </li>
  );
};
